import React, {Component} from 'react'
import data from "./sectionInfo.json"

class DisplayTable extends Component {

    render() {
        var contentKeys = Object.keys(data.content);
        return (
            
            <div>
                <h1>{contentKeys}</h1>
            </div>
        )
    }
        

    
}
    
export default DisplayTable
